Para o balanço energético, calculamos sua Taxa Metabólica Basal (TMB) usando a fórmula de Mifflin-St Jeor, que resulta em aproximadamente 1601 kcal. Considerando um nível de atividade moderado, seu Gasto Energético Total Diário (TDEE) é estimado em cerca de 2482 kcal. Com um consumo médio de 1806 kcal/dia, você está atualmente com um déficit calórico de aproximadamente 676 kcal/dia.

A análise da sua ingestão de macronutrientes mostra que você está consumindo em média 116.6g de proteína (26% das calorias), 159.4g de carboidratos (35% das calorias) e 75.5g de gorduras (38% das calorias). Comparando com suas metas nutricionais diárias de 160g de proteína, 170g de carboidratos e 55g de gorduras, sua ingestão de proteína está abaixo do recomendado, enquanto o consumo de gordura está acima da meta.

A análise temporal do seu peso nos últimos 16 dias mostra uma pequena variação de -0.3 kg. Observando o histórico dos últimos 10 registros, percebe-se uma leve tendência de queda no peso, embora com algumas flutuações. A taxa de mudança é muito pequena para tirar conclusões significativas.

Em resumo, você está com um déficit calórico moderado, o que pode contribuir para a manutenção do peso, mas a ingestão de proteína está abaixo da meta, o que pode afetar a preservação da massa magra. Ajustar a ingestão de macronutrientes, especialmente aumentando a proteína e diminuindo a gordura, pode otimizar sua composição corporal e saúde geral.', '{"Aumente sua ingestão de proteína para 145g por dia. Distribua essa quantidade ao longo do dia, consumindo 35g no café da manhã, 40g no almoço, 40g no jantar e 30g em lanches.","Reduza sua ingestão de gordura para 60g por dia. Priorize fontes de gordura saudáveis, como abacate, azeite de oliva e oleaginosas.","Mantenha seu consumo de carboidratos em torno de 170g por dia, priorizando carboidratos complexos como grãos integrais, frutas e vegetais.","Ajuste seu déficit calórico para cerca de 500 kcal/dia para uma perda de peso mais sustentável e para preservar a massa magra. Isso significa aumentar sua ingestão calórica diária para cerca de 1982 kcal.","Considere incluir uma fonte de proteína de rápida absorção, como whey protein, após o treino para auxiliar na recuperação muscular."}', '{"Sua ingestão de proteína de 1.6g/kg de peso corporal está abaixo do ideal para a preservação da massa magra, especialmente considerando o déficit calórico.","Seu consumo de gordura está acima da meta estabelecida, o que pode estar contribuindo para um déficit calórico menor do que o desejado.","Apesar do déficit calórico, a pequena variação no peso sugere que o corpo pode estar se adaptando ou que a composição corporal (perda de gordura e ganho de massa magra) está mudando.","O padrão alimentar, com uma média de 3-4 refeições por dia, parece adequado, mas a qualidade das refeições pode ser melhorada com escolhas alimentares mais saudáveis.","As refeições recentes mostram uma combinação de alimentos saudáveis (tilápia grelhada, batata assada, iogurte whey) com opções menos nutritivas (pão de queijo, mousse de doce de leite), indicando espaço para melhorias na qualidade da dieta."}', '{"O déficit calórico de 676 kcal/dia pode levar à perda de massa muscular se a ingestão de proteína não for adequada.","O consumo elevado de alimentos processados e ricos em açúcar pode comprometer a saúde metabólica e dificultar a perda de gordura."}', 'gemini-2.0-flash-exp', '2025-11-08 06:57:59.455161'),
