Nos últimos 34 dias, você apresentou uma variação de peso de -1.4 kg, indicando uma perda de peso. Considerando o déficit calórico médio de 623 kcal/dia, a taxa de perda de peso esperada seria de aproximadamente 0.5 kg por semana (3500 kcal = 0.45kg de gordura). Sua perda de peso real está alinhada com essa estimativa. 

