mente 783 kcal/dia (e 977 kcal/dia na última semana) é alto e pode levar à perda de massa muscular. Recomenda-se ajustar a ingestão calórica para um déficit mais moderado de 500 kcal/dia.","A ingestão de carboidratos está ligeiramente abaixo da meta (120.3g vs 170g). Aumentar o consumo de carboidratos complexos pode melhorar a energia e a recuperação muscular."}', 'gemini-2.0-flash-exp', '2025-12-26 05:57:39.833257'),
