es": null, "value": "no_processed", "severity": "moderate"}, {"type": "preference", "notes": null, "value": "pouca carne vermelha", "severity": "moderate"}]}', 'Com base nos dados fornecidos, seu peso atual é de 70.9 kg. Utilizando o método da Marinha dos EUA para estimar a gordura corporal, com as medidas de cintura (81.7 cm), pescoço (36 cm) e altura (176 cm), a sua percentagem de gordura corporal é estimada em aproximadamente 17.5%. Isso significa que sua massa magra é de aproximadamente 58.5 kg. 

Para avaliar seu balanço energético, primeiro calculamos sua Taxa Metabólica Basal (TMB) usando a fórmula de Mifflin-St Jeor: TMB = (10 x peso em kg) + (6.25 x altura em cm) - (5 x idade em anos) + 5. Isso resulta em uma TMB de aproximadamente 1601 kcal. Considerando seu nível de atividade moderada (3-5 dias/semana), seu Gasto Energético Total Diário (TDEE) é estimado em torno de 2482 kcal (TMB x 1.55). Seu consumo calórico médio diário é de 1635 kcal, o que indica um déficit calórico de aproximadamente 847 kcal por dia.

Analisando sua ingestão de macronutrientes, você consome em média 138.3g de proteína (34% das calorias), 116.9g de carboidratos (29% das calorias) e 67.2g de gorduras (37% das calorias). Suas metas nutricionais diárias são 160g de proteína, 170g de carboidratos e 70g de gorduras. Sua ingestão de proteína está um pouco abaixo da meta, enquanto a ingestão de carboidratos está consideravelmente abaixo. A ingestão de gordura está próxima da meta.

