ll, "value": "no_processed", "severity": "moderate"}, {"type": "preference", "notes": null, "value": "pouca carne vermelha", "severity": "moderate"}]}', 'Com base nos dados fornecidos, seu peso atual é de 71.00 kg. Utilizando o método da Marinha dos EUA para estimar a gordura corporal, com as medidas de cintura (81.7 cm), pescoço (36 cm), altura (176 cm), e considerando o gênero masculino, a sua porcentagem de gordura corporal é estimada em aproximadamente 16.5%. Isso resulta em uma massa magra de aproximadamente 59.3 kg.

