t calórico moderado, mas é importante monitorar a composição corporal para garantir que a perda de peso seja principalmente de gordura."}', '{"O déficit calórico de 822 kcal/dia pode ser excessivo e aumentar o risco de perda de massa muscular. Considere reduzir o déficit para 500 kcal/dia para uma perda de peso mais sustentável.","A ausência de dados de micronutrientes impede a identificação de possíveis deficiências nutricionais. É crucial registrar os alimentos com informações completas de micronutrientes para uma avaliação adequada.","Devido às suas alergias ao glúten e ao trigo, é fundamental garantir que todos os alimentos consumidos sejam isentos desses ingredientes para evitar reações alérgicas."}', 'gemini-2.0-flash-exp', '2025-12-29 09:29:09.675519');


